'use strict';

var NS = {};


// MODULES //

var getKeys = require( 'object-keys' ).shim();
NS.abs = require( '@stdlib/math/base/special/abs' );
NS.acos = require( '@stdlib/math/base/special/acos' );
NS.acosh = require( '@stdlib/math/base/special/acosh' );
NS.asin = require( '@stdlib/math/base/special/asin' );
NS.asinh = require( '@stdlib/math/base/special/asinh' );
NS.atan = require( '@stdlib/math/base/special/atan' );
NS.atanh = require( '@stdlib/math/base/special/atanh' );
NS.cbrt = require( '@stdlib/math/base/special/cbrt' );
NS.ceil = require( '@stdlib/math/base/special/ceil' );
NS.copysign = require( '@stdlib/math/base/special/copysign' );
NS.cos = require( '@stdlib/math/base/special/cos' );
NS.cosh = require( '@stdlib/math/base/special/cosh' );
NS.cospi = require( '@stdlib/math/base/special/cospi' );
NS.deg2rad = require( '@stdlib/math/base/special/deg2rad' );
NS.digamma = require( '@stdlib/math/base/special/digamma' );
NS.eta = require( '@stdlib/math/base/special/dirchlet-eta' );
NS.erf = require( '@stdlib/math/base/special/erf' );
NS.erfc = require( '@stdlib/math/base/special/erfc' );
NS.erfcinv = require( '@stdlib/math/base/special/erfcinv' );
NS.erfinv = require( '@stdlib/math/base/special/erfinv' );
NS.exp = require( '@stdlib/math/base/special/exp' );
NS.exp2 = require( '@stdlib/math/base/special/exp2' );
NS.expm1 = require( '@stdlib/math/base/special/expm1' );
NS.factorial = require( '@stdlib/math/base/special/factorial' );
NS.flipsign = require( '@stdlib/math/base/special/flipsign' );
NS.floor = require( '@stdlib/math/base/special/floor' );
NS.frexp = require( '@stdlib/math/base/special/frexp' );
NS.gamma = require( '@stdlib/math/base/special/gamma' );
NS.gammaln = require( '@stdlib/math/base/special/gammaln' );
NS.ldexp = require( '@stdlib/math/base/special/ldexp' );
NS.ln = require( '@stdlib/math/base/special/ln' );
NS.log2 = require( '@stdlib/math/base/special/log2' );
NS.log10 = require( '@stdlib/math/base/special/log10' );
NS.log1p = require( '@stdlib/math/base/special/log1p' );
NS.pow = require( '@stdlib/math/base/special/pow' );
NS.powm1 = require( '@stdlib/math/base/special/powm1' );
NS.rad2deg = require( '@stdlib/math/base/special/rad2deg' );
NS.zeta = require( '@stdlib/math/base/special/riemann-zeta' );
NS.round = require( '@stdlib/math/base/special/round' );
NS.roundn = require( '@stdlib/math/base/special/roundn' );
NS.signum = require( '@stdlib/math/base/special/signum' );
NS.sin = require( '@stdlib/math/base/special/sin' );
NS.sinh = require( '@stdlib/math/base/special/sinh' );
NS.sinpi = require( '@stdlib/math/base/special/sinpi' );
NS.sqrt = require( '@stdlib/math/base/special/sqrt' );
NS.tan = require( '@stdlib/math/base/special/tan' );
NS.tanh = require( '@stdlib/math/base/special/tanh' );
NS.trunc = require( '@stdlib/math/base/special/truncate' );


// VARIABLES //

var KEYS = getKeys( NS );


// BIND //

/**
* Assigns values to a namespace.
*
* @private
* @param {Object} ns - namespace
* @returns {Object} input namespace
*
* @example
* var ns = {};
* assign( ns );
* // ns => {...}
*/
function assign( ns ) {
	var key;
	var i;
	for ( i = 0; i < KEYS.length; i++ ) {
		key = KEYS[ i ];
		ns[ key ] = NS[ key ];
	}
	return ns;
} // end FUNCTION assign()


// EXPORTS //

module.exports = assign;
